import React from 'react';
import './App.css';
import logo from './logo.jpg';

function Header() {
  return (
    <div className="header-wrapper" height='20em' backgroundColor='black'>
        <img src={logo} alt="Explore Edinburgh Logo" width='20%'/>;
    </div>
  );
}

export default Header;
